import {React,useState,useEffect} from 'react'
import axios from 'axios'

const apiurl=`https://jsonplaceholder.typicode.com/posts`

export default (props) =>{


 {
    //state Object Implementations by HOOKS
    var [posts,setStatePosts] =useState([]);
   
    useEffect(()=>
    {
    axios.get(apiurl).then((result)=>this.setStatePosts(result.data))
    },[])


    return (<>
             

       <div className='container p-5'>

        <h1 className='text-center py-3'>REACT Hooks Pagination</h1>
      
         <br/> <br/>

         {/* Pagination */}
        <nav>
            <ul class="pagination">
                <li class="page-item"><a class="page-link" href="#">Previous</a></li>
                <li class="page-item"><a class="page-link" href="#">1</a></li>
                <li class="page-item"><a class="page-link" href="#">2</a></li>
                <li class="page-item"><a class="page-link" href="#">3</a></li>
                <li class="page-item"><a class="page-link" href="#">Next</a></li>
            </ul>
        </nav>





         <div className='row'>
         {

            posts.map((res,i)=>
            {
                return(<ul key={i}>
                           <li>
                               <h4>{res.id}.{res.title}</h4>
                               <p>{res.body}</p>
                           </li>
                    </ul>)
                })

                }


         </div>

       </div>
       
      

      </>)
 }
}
